import "./App.css";

import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route } from "react-router-dom";

// componentes
import Navbar from "./components/Navbar";
import Home from "./components/Home";

function App() {
  return (
    <Router>
      // navbar es constante
      <Navbar />
      <Route path="/" exact>
        <Home />
      </Route>
    </Router>
  );
}

export default App;
